import React from 'react';
import './Mousse.css';

function Mousse() {
  const numberOfDrops = 50; // Change this number to adjust the number of drops

  // Array to store drop components
  const drops = [];

  // Generate drop components
  for (let i = 0; i < numberOfDrops; i++) {
    drops.push(
      <div key={i} className={`drop drop${i % 2 === 0 ? 1 : 2}`}></div>
    );
  }

  return <div className="c">{drops}</div>;
}

export default Mousse;
